import './App.css'
 import {
   BrowserRouter,
   Link,
   Switch,
   Route
 } from 'react-router-dom';

import Login from '../components/login.js'

function App()
{
  return(
    <div className="App">
      <BrowserRouter>
      <div>
            <Link to="/">LOGIN</Link>
      </div>
      </BrowserRouter>
      <Switch>
        <Route path="/">
          <Login />
        </Route>
      </Switch>
    </div>
  )
}

export default App;
